import React from 'react';
import '../../App.css';

function Contact() {
  return (
    <>
      <div style={{ textAlign: 'center', fontSize: '36px', marginBottom: '20px' }}>Send Us an Email</div>
      <div style={{ textAlign: 'center', fontSize: '20px' }}>
        <ul style={{ listStyleType: 'none', padding: '0' }}>
          <li><strong>John Doe:</strong> john@example.com</li>
          <li><strong>Jane Smith:</strong> jane@example.com</li>
          <li><strong>Michael Johnson:</strong> michael@example.com</li>
          {/* Add more people and their emails as needed */}
        </ul>
      </div>
    </>
  );
}

export default Contact;
